●付属のLINE INケーブルでスマートフォン/iPhone等のφ3.5mmイヤホン端子に接続し、カーステレオのFMラジオで聴ける、FMトランスミッター。<br>
●microSDカード、USBメモリの音楽データを再生できるプレーヤー機能付。<br>
●周波数76.0MHz～90.0MHzの範囲から0.1MHz間隔で選択できるフルバンドタイプ。（141ch）<br>
●音楽リモコン機能付、再生、一時停止、曲送り、曲戻しの操作ができます。<br>
 （*microSD、USBメモリのみ使用可能。）<br>
●お好みの音質を7種類から選べるイコライザー機能付。<br>
 （*microSD、USBメモリのみ使用可能。）<br>
ノーマル/ポップ/ロック/ジャズ/クラシック/カントリー/ローバス<br>
●純正のUSBケーブル等で充電しながら使用できる、USB出力端子付き。<br>
●ディスプレイ部分は上下に可動。操作/確認しやすい角度に調節できます。<br>
●12V、24V車兼用。<br>
●微弱無線局規定品。<br><br>

*USBコードは付属していません。必ず純正のUSBコードにて充電してください。<br>
*本製品はモノラル出力となります。左右の音がMIXしてカーオーディオのFMラジオから出力されます<br><br>

