Bluetooth対応のスマートフォン/iPhoneの音楽やワンセグ音声をワイヤレスで受信、さらにワイヤレスでFMラジオに送信。<br>カーステレオから高音質で聴くことができます。<br>Bluetoothバージョン3.0仕様。<br>（従来のバージョンとも互換性があり、従来のバージョンの携帯電話でも使用できます。）<br>安定した周波数と幅広い音域を実現。<br>周波数を選ぶだけの簡単操作。(88.1/88.3/88.5/88.7MHz) A2DPプロファイルSCMS-T対応。<br>車のエンジンを切ると、本製品のエンジン連動機能により、スマートフォン/iPhoneの曲が自動で一時停止。<br>エンジンをONにすると自動で接続します。<br>（一部の機種では自動停止/自動接続できない場合があります。）<br>本体の角度を調節できます。<br>最大1.8A出力のハイパワーUSB充電ポート付。<br>充電しながら音楽やワンセグを聴くことができます。<br>*USBコードは付属していません。<br><br><br><br>■仕様■<br>12V車/24V車共用<br>無線方式：Bluetooth ver.3.0<br>無線距離：約10m以内<br>対応プロファイル： アドバンスオーディオディストリビューション(A2DP)<br>製品寸法：48W x 48H x 93D(mm)<br>製品重量：39g<style type="text/css">
